// src/pages/AdminList.jsx
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

export default function AdminList() {
  const [admins, setAdmins] = useState([]);

  useEffect(() => {
    api.get('/admins').then(response => setAdmins(response.data));
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h2>Admins Cadastrados</h2>
        <div>
          <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
          <Link to="/admins/novo" className="btn btn-primary">+ Cadastrar Novo Admin</Link>
        </div>
      </div>
      <ul className="list-group">
        {admins.map(admin => (
          <li key={admin._id} className="list-group-item">
            <strong>{admin.nome}</strong> – {admin.email} ({admin.nivelAcesso})
          </li>
        ))}
      </ul>
    </div>
  );
}
